import React from 'react';
import logo from './logo.svg';
import './App.css';
import QRCode from 'qrcode.react';

function App() {
  return (
    <div className="App">

      <QRCode
                  id='qrcode'
            value='https://viblo.asia/u/tranchien'
            size={290}
            level={'H'}
            includeMargin={true}
/>
    </div>
  );
}

export default App;
